import React from "react";

function Todo({ todo, completed, userId }) { 
  return (
    <tr className="todos">
      <td className="todo">{todo}</td>
      <td className="todo__status">{completed ? "Выполнено" : "Не выполнено"}</td>
      <td className="todo__user">{userId}</td>
    </tr>
  );
}

export default Todo;
